import React, { Fragment, useState } from 'react';

const Formulario = () => {
    return (
        <>
            <h1>Formulario de Mudanzas</h1>
            <form>
                <div className="form-group">
                    <label for="cedula">Cédula</label>
                    <input type="text" className="form-control" id="cedula" name="cedula" placeholder="Cédula" />
                    <small id="cedulaHelp" className="form-text text-muted">Campo obligatorio</small>
                </div>
                <div className="form-group">
                    <label for="archivo">Archivo</label>
                    <input type="file" className="form-control" id="archivo" name="archivo" placeholder="Archivo" accept=".txt" />
                </div>
                <button type="submit" className="btn btn-primary">Procesar</button>
            </form>
        </>
    );
}

export default Formulario;
